import React from "react";
import "../css/demo-14.css";
import "../css/skin-demo-14.css";

export default function Main() {
  return (
    <div>
      <div className="intro-slider-container">
        <div
          className="owl-carousel owl-simple owl-light owl-nav-inside"
          data-toggle="owl"
          data-owl-options='{"nav": true}'
        >
          {/* <div
            className="intro-slide"
            style={{
              backgroundImage:
                "url(assets/images/demos/demo-2/slider/slide-1.jpg)",
            }}
          > */}
          <div className="container intro-content">
            <h3 className="intro-subtitle">Bedroom Furniture</h3>
            {/* <!-- End .h3 intro-subtitle --> */}
            <h1 className="intro-title">
              Find Comfort <br />
              That Suits You.
            </h1>
            {/* <!-- End .intro-title --> */}

            <a href="category.html" className="btn btn-primary">
              <span>Shop Now</span>
              <i className="icon-long-arrow-right"></i>
            </a>
          </div>
          {/* <!-- End .container intro-content --> */}
          {/* </div> */}
          {/* <!-- End .intro-slide --> */}
        </div>
        {/* <!-- End .owl-carousel owl-simple --> */}

        {/* <span className="slider-loader text-white"></span> */}
        {/* <!-- End .slider-loader --> */}
      </div>
      {/* <!-- End .intro-slider-container --> */}
    </div>
  );
}
